Story:  Dan Shotz, Robert Levine, and Kalinda Vazquez
Writer:  Kalinda Vazquez
Artist:  Erfan Fajar
Colorists:  David Baron and Allen Passalaqua
Letterer:  Neil Uyetake
Cover:  Erfan Fajar

Jericho is back with a vengeance, with a whole new chapter of stories told in the show's official continuity. Jericho Season Four picks up where Season Three left off. Though Jake and Hawkins are happy to be back in Jericho, the challenges they face are daunting. Not only are they fugitives in their own hometown, but they find themselves forced to play host to the newest member of the Jericho community -- John Smith... a man who some know as a friend of the resistance, but who Jake and Hawkins know as the man behind the September Attacks. Only they know his secret. And only they can stop him from committing another heinous act.

